double bound(double const val)
{
    return(val < 0 ? 0 : (val > 1.0 ? 1.0 : val));
}
double ent(double p)
{
    if (p == 0)
    {
        return(0);
    }
    if (p==1.0)
    {
        return(0);
    }

    return(- p * (log2(p)+(1-p) * log2(1-p)));
}
double siginfo(double p1, double p2)
{
    return(1 - (((p1 + p2)/2) * ent(p1/ ( p1 + p2)) + (1 - ((p1 + p2)/2)) * ent((1-p1)/ ((1-p1)+(1-p2)))));
}

